    const contact= useRef(null);

    return (
        <div className="scroll">
            <div className='hero'>
            <ul>
                <li className='link'>services</li>
                <li className='link'>blog</li>
                <li className='link'>contact</li>
            </ul>
        </div>
        <div className='services'>
        <h3>Services</h3>
        </div>
        <div className='blog'>
        <h3>blog</h3>
        </div>
        <div className='contact'>
        <h3>contact</h3>
        </div>
        </div>
    )
}

export default Scroll;
